// import img1 from "../assets/images/slider/1.png"
// import img2 from "../assets/images/slider/2.png"
import React from 'react'
import SimpleImageSlider from "react-simple-image-slider";
const images = [
    { url: "src/assets/images/slider/1.png" },
    { url: "src/assets/images/slider/2.png" },
  ];
const SimpleImageSliderHome = () => {
  return (
    <div>
        <SimpleImageSlider
        width={896}
        height={504}
        images={images}
        showBullets={true}
        showNavs={true}
      />
    </div>
  )
}

export default SimpleImageSliderHome
